function getColor(d) {
  return d > 2000
    ? '#800026'
    : d > 1000
    ? '#BD0026'
    : d > 400
    ? '#E31A1C'
    : d > 200
    ? '#FC4E2A'
    : d > 166
    ? '#FD8D3C'
    : d > 100
    ? '#FEB24C'
    : d > 10
    ? '#fffdaf'
    : '#eaeaeb';
}

function style(feature) {
  return {
    fillColor: getColor(feature.properties.deaths),
    weight: 1,
    opacity: 1,
    color: 'black',
    dashArray: '0',
    fillOpacity: 0.7,
  };
}

function styleTwo(feature) {
  return {
    weight: 1,
    opacity: 0.1,
    color: 'grey',
    dashArray: '0',
  };
}

function highlightFeature(e) {
  var layer = e.target;

  layer.setStyle({
    weight: 5,
    color: '#666',
    dashArray: '',
    fillOpacity: 0.7,
  });

  if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
    layer.bringToFront();
  }
  info.update(layer.feature.properties);
}

