function createPopupText(state, deaths, cases, caseCapita) {
  return `<div class="fade"><b><span class="state">${state}</span></b></br><hr><div class="flex-between deaths"><span>Tode:</span><span class="result">${deaths}</span></div></br><div class="flex-between deathCapita"><span>Tode/100Tsd</span><span class="result">${caseCapita}</span></div></br><div class="flex-between cases"><span>FÃ¤lle:</span><span class="result">${cases}</span></div></br></div>`;
}

function numberWithDot(x) {
  return x.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ".");
}

// specify popup options 
var customOptions =
    {
    'className' : 'popupCustom'
    }

geojson = L.geoJson(statesData, {
  style: style,
  onEachFeature: function(feature, layer) {
    // layer.bindPopup(feature.geometry.coordinates.join(','));
    layer.bindPopup(createPopupText(feature.properties.NAME_1, numberWithDot(feature.properties.deaths), numberWithDot(feature.properties.cases), feature.properties.casesCapita.toString().replace('.', ',')), customOptions);
    layer.on('mouseover', function(){
      layer.setStyle({weight: 2.5, opacity: 0.7});
      this.openPopup();
    })
    layer.on('mouseout', function(){
      // layer.setStyle({fillColor: 'blue'});
      this.closePopup();
      layer.setStyle({weight: 1, opacity: 1});
    })
  }
}).addTo(map);

